import React from 'react';

const styles = {
  div: {
    margin: "20px",
    padding: "10px",
  },
  headingStyle: {
    fontSize: '100px',
  },
};

export default function Contact() {
  return (
    <div>
      <h1 style={styles.headingStyle}>contact</h1>
      <form class="form-floating needs-validation">
        <div class="form-floating mb-3">
          <input type="name" class="form-control" id="floatingInput" placeholder="name" required></input>
          <label for="floatingInput">name</label>
        </div>
        <input type="email" class="form-control is-invalid" id="floatingInputInvalid" placeholder="name@example.com" required></input>
        <label for="floatingInputInvalid">invalid input</label>
        <div class="form-floating">
          <textarea class="form-control" placeholder="Leave a comment here" id="floatingTextarea2" style="height: 100px" placeholder="Write your message here" required></textarea>
          <label for="floatingTextarea2">Comments</label>
        </div>
        <div class="mb-3">
          <button class="btn btn-primary" type="submit" disabled>Submit form</button>
        </div>
      </form>
    </div>
  );
}
